import React from 'react'

const User = ({ user }) => {
  return (
    <div>
            <img src={`Thumbnail: ${user.picture.thumbnail}`} alt=""></img>

      <hr />
      <p>{`Full Name: ${user.name.title} ${user.name.first} ${user.name.last}`}</p>
      <p>{`Username: ${user.login.username}`}</p>
    </div>
  )
}

export default User
